                                        RFE_HW_SPIM_ACC_RFE_RAW_STATUS_REG,
                                        RFE_HW_SPIM_ACC_RFE_RAW_STATUS_MCGEN_STATUS_MCGEN_0V9_ANA_OK_BIT,
                                        RFE_ERROR_FUNCTION_ARGUMENT );
    if ( mcgen0v9AnaFlag )
    {
        RFE_WAIT_SETCOMPLETED;
    }
    else
    {
        // keep waiting for timeout
    }
}RFE_WAIT_WHILE;

