        //This function initializes Analog Central Control (ACC) unit (HW SPIM IP).
        rfeSwInit_step_6_initSpim( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function programming trimming values from OTP to all IPs registers ( except for PDC and ADC )
        rfeSwInit_step_7_programTrimmingValues( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function switches GLDO IP to power on mode.
        rfeSwInit_step_8_configGldo( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function switches Gbias IP to power on mode.
        rfeSwInit_step_9_configGbias( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function checks XOSC status and FCCU reset errors.
        //ERROR on M3SA: rfe_error_initMcgen0v9AnaNotOk_e as there is analog behaviour expected => works on Silicon
#ifndef BUILD_FOR_M3SA
        rfeSwInit_step_10_checkXoscOk( RFE_ERROR_FUNCTION_ARGUMENT );
#endif

        //This function initialize analog IPs registers ( except for PDC and ADC )
        rfeSwInit_step_11_initAnalogIpsRegisters( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function switches analog IPs from power down to standby mode (except for RXADC, ADPLL and MCGEN)
        rfeSwInit_step_12_analogIPsStandBy( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function switches LLDOPDC to power on mode and configures RX ADC.
        // After this step SPI access is error free as all IPs are on
        rfeSwInit_step_13_configLLDOPDCandRxADC( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function switches Mcgen IP to power on mode.
        //ERROR on M3SA: rfe_error_mcgen0v9AnaNotOk_e as there is analog behaviour expected => works on Silicon
#ifndef BUILD_FOR_M3SA
        rfeSwInit_step_14_powerOnMcgen( RFE_ERROR_FUNCTION_ARGUMENT );
#endif

        //This function configures Clock Generation Module (CGM).
        rfeSwInit_step_15_configureClocking( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function signals that the SoC side can switch to 640Mhz clock generated by Master Clock
        rfeSwInit_step_16_reportClockPllReady( RFE_ERROR_FUNCTION_ARGUMENT );

        //TODO: skip this function for Jan release
        //This function calibrates RX ADC.
#ifndef BUILD_FOR_M3SA
        rfeSwInit_step_17_calibrateRxAdc( RFE_ERROR_FUNCTION_ARGUMENT );
#endif
        //TODO: skip this function for Jan release
        //This function calibrates ATB ADC.
#ifndef BUILD_FOR_M3SA
        rfeSwInit_step_18_calibrateAtbAdc( RFE_ERROR_FUNCTION_ARGUMENT );
#endif

        //This function marks each startup configuration step as okay in ISM in a defined order.
        rfeSwInit_step_19_acknowledgeStartupConfig( RFE_ERROR_FUNCTION_ARGUMENT );

        //This function checks errorN status
        rfeSwInit_step_20_checkErrorN( RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwInit_step_21_performHwFitTest( RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwInit_step_22_performSwFitTest( RFE_ERROR_FUNCTION_ARGUMENT );

        // This function issues error reset in FCCU and checks errorN status
        rfeSwInit_step_23_fusaStateNormal( RFE_ERROR_FUNCTION_ARGUMENT );
    }
